(59,	3,	'iPhone Repair',	'&lt;p&gt;Modern smartphones are technologically advanced devices allowing anyone to check their email, navigate via GPS, and even manage finances all on the go. Among these mobile devices, the iPhone remains one of the leading contenders in the market. Having access to a trustworthy iPhone repair service can help users keep their devices running in top shape.&lt;/p&gt;\r\n\r\n&lt;p&gt;At uBreakiFix, we offer top notch repairs, extremely fast turnaround times, and excellent customer service. Whether you have the latest iPhone 5S / 5C or previous models such as the iPhone 4, iPhone 4S, iPhone 3GS or iPhone 3G, our repair services assure you of the finest repair quality and the fastest repair time available. We also cover both the Verizon, AT&amp;amp;T or Sprint versions.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our iPhone repair services cover glass and LCD replacement, water damage, headphone jack replacement, home button repair, battery replacements and more. We can also fully refurbish any model iPhone to ensure that your phone looks and functions as good as new.&lt;/p&gt;\r\n\r\n&lt;p&gt;Their are 2 options available to fix your iphone. Your can choose to bring your iPhone in to one of our Nationwide walk-in repair locations in for speedy service where most repairs can be completed in less than 30 minutes or less. If you\'re not close to one of our local repair shops you also have the option to mail your iPhone in which usually takes about 4-7 business days.&lt;/p&gt;\r\n\r\n&lt;p&gt;For most of our iPhone repair services, we offer a same day turn around guarantee to assure you that no time is wasted in the repair of your device. As always we offer free diagnostics for all iPhones if you are not sure what damage your device has suffered.&lt;/p&gt;\r\n',	'iPhone Repair for iPhone 4, 4S, 5, 5S &amp; 5C - 90 Day Warranty on all Repairs &amp; Fastest Turnaround!  Call 877-320-2237 for Nearest iPhone Repair Locations',	''),
(71,	2,	'Réparation de HTC ',	'<h2>Le service de réparation de HTC</h2>\n\n<p>Les téléphones intelligents sont largement considérés comme étant une nécessité dans le monde aujourd\'hui. Parmi les fabricants de téléphones intelligents, HTC se distingue comme l\'un des fabricants les plus innovants sur le marché. Du HTC Aria au HTC Evo 4G, uBreakiFix offre un service de réparation qui couvrera votre appareil.</p>\n\n<p>Les téléphones intelligents HTC qui sont alimentés par Android ou Windows sont considérés comme étant les appareils les plus attrayants disponibles aux utilisateurs. Chez uBreakiFix, nous offrons des services de réparation qui couvrent presque tous les téléphones HTC, des petits modèles comme le HTC Incredible ou Aria jusqu\'au plus nouveaux modèles tels que le HTC EVO HD et le HTC Thunderbolt. Que votre téléphone ait une vitre brisé ou qu\'il soit endommagé par l\'eau, les techniciens experts chez uBreakiFix savent le réparer.</p>\n\n<p>Nous techniciens sont formés pour effectuer presque toutes les réparations de HTC d\'une manière experte avec seulement des pièces de hautes qualités. Nos centres de réparation sont situés dans tout le pays et sont fier d\'offrir une garantie de 90 jours sur les pièces et la main d\'oeuvre pour toutes les réparations de HTC. La majorité des réparations HTC peuvent être complété en 30 minutes ou moins pendant que vous attendez.</p>\n\n<p>Si vous n\'êtes pas situé près de l\'un de nos centre de réparation, vous pouvez nous l\'envoyez par la poste et on peutcompléter et retourner votre appareil en aussi peu que 2 jours. Notre service de réparation par la poste garantie que nous finissons la réparations en moins de 8 heures sur la majorité des appareils HTC. Si votre appareilfonctionne mal ou si vous n\'êtes pas sûr des services requis pour réparer votre téléphone, nous pouvons offfrir un diagnostic afin de déterminer ce que votre HTC nécessite comme réparation(s).</p> \n',	'Réparation de HTC  avec des délais d\'exécution rapide; Un service de  réparation de qualité garantie, Appelez au 877-320-2237 afin de trouver le centre de réparation le plus près de chez vous!',	''),
