(59,	2,	'Réparation de iPhone ',	'&lt;p&gt;Les téléphones intelligents modernes sont des appareils technologiquement avancés qui permettent à quiconque de vérifier leurs courriels, naviguer par GPS, et même gérer leurs finances sur la route. Parmis ces appareils mobiles, le iPhone reste l\'un des principaux prétendants sur le marché. Avoir accès à un service de réparation de iPhone digne de confiance peut aider les utilisateurs à garder leurs appareils en plein forme.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Chez uBreakiFix, nous offrons des réparations de la meilleure qualité, les délais d\'exécution extrêmement rapide et un service à la clientèle hors pair. Que vous ayez le dernier iPhone 5S/%c ou des modèles antérieures tels que le iPhone 4, iPhone 4S, iPhone 3GS ou iPhone 3G, nos services de réparation notre service vous assure d\'une réparation de qualité et fini dans un temps le plus rapide disponible. Nous couvrons également les versions Verizon, AT&amp;amp;T ou Sprint.&lt;/p&gt;\r\n\r\n&lt;p&gt;Nos services de réparation de iPhone couvrent la vitre et le LCD de remplacement, les dégâts d\'eau, la prise audio, le bouton &quot;home&quot;, remplacement de la batterie et plus. Nous pouvons également entièrement remettre en état tous les modèles de iPhone pour que votre appareil fonctionne à merveille et qui ait toujours l\'air neuf.&lt;/p&gt;\r\n\r\n&lt;p&gt;Il y a deux options disponibles pour faire réparer votre iPhone. Vous pouvez choisir soit d\'apporter votre iPhone dans un de nos magasin pour une réparation rapide ou presque toutes les réparations peuvent être complétées en 30 minutes ou moins. Si vous n\'êtes pas assez près d\'un emplacement de réparation, vous avez aussi la possibilité d\'envoyer votre iPhone par la poste ce qui prend habituellement 4 à 7 jours ouvrables.&lt;/p&gt;\r\n\r\n&lt;p&gt;Pour la plupart de nos services de réparation du iPhone, nous offrons une garantie que nous finirons la réparation la journée même pour vous assurer qu\'il n\'y a aucune perte de temps durant la réparation de votre appareil. Comme toujours, nous offrons aussi des diagnostics gratuits pour tous les iPhones si vous n\'êtes pas sûr des dommages de votre appareil.&lt;/p&gt;\r\n',	'Réparation de iPhone 4, 4S, 5, 5S et 5C - Garantie de 90 jouurs sur tous les réparations et un délai d\'exécution rapide! Appelez le 877-320-2237 pour trouver les centres de réparations de iPhone',	''),
(71,	3,	'HTC Repair',	'&lt;h2&gt;Our HTC Repair Services&lt;/h2&gt;\n\n&lt;p&gt;Smartphones are widely considered a necessity in today\'s world. Among smartphone manufactures HTC has distinguished itself as one of the most innovative manufacturers on the market. From the HTC Aria to the HTC Evo 4G uBreakiFix offers a repair service that will cover your HTC device.&lt;/p&gt;\n\n&lt;p&gt;Android and Windows powered HTC smartphones are widely considered to be some of the most attractive and user friendly smartphones available. At uBreakiFix, we offer repair services that cover almost every HTC phone from smaller models like the HTC Incredible and the HTC Aria to newer models such as the HTC EVO 3D and the HTC Thunderbolt. Whether your phone has a cracked screen or is water damaged, the expert technicians at uBreakiFix have you covered.&lt;/p&gt;\n\n&lt;p&gt;Our technicians are trained to perform nearly any HTC repair in an expert fashion with only the highest quality parts available. Our walk-in repair centers are conveniently located nationwide and are proud to offer a 90 day warranty on all parts and labor for all HTC repairs. The majority of HTC repairs can be completed in 30 minutes or less while you wait.&lt;/p&gt;\n\n&lt;p&gt;If you are not located near one of our walk-in repair centers our mail-in repair facility can complete your repair and have it returned to you in as little as two days. Our mail-in service center provides an 8 hour turnaround guarantee on the majority of HTC repairs. If your phone is malfunctioning and you are unsure what service is required we can perform a diagnostic service in order to determine what HTC repair(s) are needed for your device.&lt;/p&gt;\n',	'Nationwide HTC Repair for all HTC Models - 90 Day Warranty on all Repairs &amp; Fast Turnaround!  Call 877-320-2237 to Find a Repair Location Near You!',	''),
