(70,	4,	'BlackBerry Repair',	'&lt;p&gt;&lt;strong style=&quot;line-height: 1.2em; color: rgb(0, 0, 0); font-family: Tahoma, Geneva, sans-serif; font-size: 14px; margin: 0px; padding: 0px;&quot;&gt;Our BlackBerry Repair Services&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot;&gt;Canadian manufacturer research in Motion\'s Blackberry smartphones have long indicated that the BlackBerry is the essential device for professionals on the go. From the&amp;nbsp;&lt;/span&gt;Blackberry Bold 9700&lt;span style=&quot;color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot;&gt;&amp;nbsp;to the&amp;nbsp;&lt;/span&gt;Blackberry Torch 9800&lt;span style=&quot;color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot;&gt;, uBreakiFix offers repair services for everything from broken glass to water damage. Our professionally trained technicians can get your device up and running in almost no time at all.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot; /&gt;\r\n&lt;br style=&quot;margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot; /&gt;\r\n&lt;span style=&quot;color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot;&gt;At uBreakiFix our repair services are completed by our expert staff and use only the highest quality parts available. We offer Blackberry repair services that range from glass/screen repair, battery replacement, keyboard replacement, and more. If your device has been water damaged or if you are unsure of what is wrong with it we can perform a diagnostic on it to determine what repair(s) are necessary.&amp;nbsp;&lt;/span&gt;&lt;br style=&quot;margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot; /&gt;\r\n&lt;br style=&quot;margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot; /&gt;\r\n&lt;span style=&quot;color: rgb(0, 0, 0); font-family: arial; font-size: 14px; text-align: left; &quot;&gt;We have a growing number of walk-in repair centers conveniently located throughout the nation. All of these repair centers confidently offer a 90 day warranty on all parts and labor. Most repairs can be completed in about 30 minutes while you wait, so if you are in need of a Blackberry repair trust the experts at uBreakiFix to offer the fastest repair possible at the lowest price available.&lt;/span&gt;&lt;/p&gt;\r\n',	'BlackBerry Repair with Fast Turnaround &amp; Quality Repair Service Guaranteed, Call 877-320-2237 To Find a Repair Location Near You!',	''),
